import React from 'react';
import '../styles/header.css';
import AuthPage from './authPage';

const Header = () => {
  return (
    <header>
      <div className="header-container">
        <div className="header-div">
          {/* Your header content */}
          <AuthPage />
        </div>
      </div>
    </header>
  );
}

export default Header;



